// src/pages/Upload1.jsx
import React, { useState, useCallback } from "react";
import { useDropzone } from "react-dropzone"; 
import Header from "../components/Header";
import { FilterIcon, PlusIcon, FileIcon, XIcon } from "../components/IconSet";

export default function Upload() {
  // --- State 정의 ---

  // 1. 업로드된 파일 목록 state (이제 실제 File 객체를 담습니다. 초기값은 빈 배열)
  const [uploadedFiles, setUploadedFiles] = useState([]);

  // 2. 분석 시작 상태 state
  const [isAnalyzing, setIsAnalyzing] = useState(false);

  // --- Dropzone 핸들러 ---

  // 파일이 드롭되었을 때 실행되는 콜백 함수
  const onDrop = useCallback((acceptedFiles) => {
    // 새로 업로드된 파일들을 기존 파일 목록에 추가합니다.
    setUploadedFiles(prevFiles => [...prevFiles, ...acceptedFiles]);
  }, []);

  // useDropzone 훅 초기화
  const { getRootProps, getInputProps, open, isDragActive } = useDropzone({
    onDrop,
    noClick: true, // 드롭존 영역 자체를 클릭해도 파일 탐색기가 열리지 않게 설정 (버튼으로 제어)
    noKeyboard: true,
  });

  // --- 일반 핸들러 ---

  // 파일 목록에서 파일 제거 (이제 file.name을 기준으로 제거)
  const handleRemoveFile = (fileNameToRemove) => {
    setUploadedFiles(prevFiles => prevFiles.filter(file => file.name !== fileNameToRemove));
  };

  // 분석 시작 버튼 클릭
  const handleAnalysisStart = () => {
    if (uploadedFiles.length > 0) {
      setIsAnalyzing(true);
      // (여기에 실제 분석 API 호출 로직이 들어갑니다)
      console.log("분석 시작...", uploadedFiles); // 실제 File 객체들
    } else {
      console.log("업로드할 파일이 없습니다.");
    }
  };

  return (
    <div className="w-full min-h-screen bg-white">
      {/* 1. 고정 헤더 */}
      <Header />

      {/* 2. 메인 컨텐츠 영역 */}
      <main className="w-full max-w-5xl mx-auto pt-24 pb-12 px-8">
        <div className="flex flex-col gap-6">
          
          {/* 3. 파일 업로드 드롭존 */}
          <div className="w-full min-h-[20rem] bg-[#DEF5EF]/50 rounded-xl border border-gray-200
                          flex flex-col justify-center items-center gap-4 p-6">
            
            {/* 파일이 없을 때 (업로드 버튼 표시) */}
            {uploadedFiles.length === 0 && (
              <>
                <button 
                  onClick={handleFileUpload} // 테스트용 파일 추가
                  className="flex items-center gap-2 px-6 py-3 bg-white rounded-lg border border-gray-300
                                text-gray-700 font-semibold hover:bg-gray-50 transition-colors">
                  <PlusIcon />
                  <span>파일 업로드</span>
                </button>
                <p className="text-gray-500">또는 마우스로 드래그하기</p>
              </>
            )}

            {/* 파일이 1개 이상 있을 때 (파일 목록 표시) */}
            {uploadedFiles.length > 0 && (
              <div className="w-full h-full flex flex-col gap-3 p-4">
                {uploadedFiles.map((fileName, index) => (
                  <div 
                    key={index} 
                    className="w-full flex items-center justify-between bg-white rounded-lg shadow-sm border border-gray-200 p-4"
                  >
                    <div className="flex items-center gap-3">
                      <FileIcon />
                      <span className="text-gray-800">{fileName}</span>
                    </div>
                    <button onClick={() => handleRemoveFile(fileName)}>
                      <XIcon />
                    </button>
                  </div>
                ))}
              </div>
            )}
          </div>

          {/* 4. 필터 및 분석 버튼 영역 */}
          <div className="w-full flex items-center gap-4">
            <div className="flex-grow h-16 bg-[#D9D9D9]/50 rounded-lg flex items-center px-6">
              <span className="text-gray-600">지정된 필터 목록 표시</span>
            </div>
            
            <button className="h-16 w-16 flex justify-center items-center bg-[#D9D9D9]/50 rounded-lg
                               text-gray-600 hover:bg-[#D9D9D9]/80 transition-colors">
              <FilterIcon /> 
            </button>
          </div>

          {/* 5. 분석 시작하기 버튼 (상태에 따라 변경) */}
          <button 
            onClick={handleAnalysisStart}
            disabled={isAnalyzing} // 분석 중일 때 비활성화
            className={`w-full h-16 text-white text-lg font-bold rounded-lg transition-colors
                        ${isAnalyzing 
                          ? 'bg-[#1AC0A4]/70 cursor-not-allowed' // 분석 중: 70% 투명도
                          : 'bg-[#1AC0A4] hover:bg-[#169a83]' // 기본 상태
                        }`}
          >
            {isAnalyzing 
              ? '분석 중입니다. 진행 상황은 Dashboard에서 확인하세요.' // 분석 중 텍스트
              : '분석 시작하기' // 기본 텍스트
            }
          </button>

        </div>
      </main>
    </div>
  );
}
